description:
Sunny Dodge brings to you a fresh breathe on gameplay, you have never played a game like this before. 
A game where your best score relies on your keen skills but is not too hard to frustrate you, show your friends who is top-notch at getting the highest score or beat your personal best! + 5 Achievements to unlock.
